import Meta from './Meta';
import Header from './Header';
import styled from '@emotion/styled';

// Styles
const Global = styled.div`
  font-family: Arial, Helvetica, sans-serif;
  background-color: honeydew;
  color: seagreen;
  position: absolute;
  height: 100%;
  width: 100%;
`;

const Layout = styled.div`
  width: 50%;
  margin: auto;
  text-align: center;
  display: flex;
  justify-content:
`;

const Page = (props) => (
  <Global>
    <Layout>
      <Meta />
      <Header />
      {props.children}
    </Layout>
  </Global>
);

export default Page;
